import React from "react";

import Card from "../UI/Card/Card";
import classes from "./SideBar.module.css";

const SideBar = () => {
  return (
    <Card>
      <div className={classes.sidebar}>
        <ul>
          <li>Profile</li>
        </ul>
      </div>
    </Card>
  );
};

export default SideBar;
